<?php
// Inisialisasi sesi
session_start();

// Tentukan nama pengguna dan kata sandi yang diharapkan
$expected_username = "123@!123";
$expected_password = "123@!123";

// Periksa apakah ada input nama pengguna dan kata sandi yang dikirimkan
if (isset($_SERVER['PHP_AUTH_USER']) && isset($_SERVER['PHP_AUTH_PW'])) {
// Periksa apakah nama pengguna dan kata sandi sesuai dengan nilai yang diharapkan
if ($_SERVER['PHP_AUTH_USER'] == $expected_username && $_SERVER['PHP_AUTH_PW'] == $expected_password) {
// Atur sesi dan waktu timeout 1 menit
$_SESSION['logged_in'] = true;
$_SESSION['timeout'] = time() + 600; // 1 menit timeout
echo "<h1>Selamat Datang di Halaman Terlindungi</h1>";
} else {
// Jika tidak sesuai, tampilkan pesan kesalahan
header('WWW-Authenticate: Basic realm="Restricted Area"');
header('HTTP/1.0 401 Unauthorized');
echo "<h1>401 Unauthorized</h1>";
exit();
}
} else {
// Jika tidak ada input, tampilkan dialog otentikasi
header('WWW-Authenticate: Basic realm="Restricted Area"');
header('HTTP/1.0 401 Unauthorized');
echo "<h1>401 Unauthorized</h1>";
exit();
}

// Periksa waktu timeout sesi
if (isset($_SESSION['timeout']) && time() > $_SESSION['timeout']) {
// Hapus sesi dan redirect ke halaman login
session_destroy();
header("Location: login.php");
exit();
}
?>


